import React from 'react';

class Title extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      logo_head: "Flash Box",
      slogan: "Express Courier Services",
    };
  }
  render() {
    return (
      <div>
        <h1>{this.state.logo_head}</h1>
          <h2>{this.state.slogan}</h2>
      </div>
    );
  }
}
export default Title
